class Solution {
    func minimumTime(_ nums1: [Int], _ nums2: [Int], _ x: Int) -> Int {
        let n = nums1.count
        var prefixSum = [Int](repeating: 0, count: n + 1)
        for i in 0..<n {
            prefixSum[i + 1] = prefixSum[i] + nums1[i]
        }

        var total = prefixSum[n]
        if total <= x { return 0 }

        var result = Int.max
        var suffixSum = 0
        for i in stride(from: n - 1, through: 0, by: -1) {
            suffixSum += nums2[i]
            total -= nums1[i]
            var low = 0, high = i, best = -1
            while low <= high {
                let mid = low + (high - low) / 2
                if prefixSum[mid] + suffixSum + total <= x {
                    best = mid
                    high = mid - 1
                } else {
                    low = mid + 1
                }
            }
            if best != -1 {
                result = min(result, n - i + best)
            }
        }

        return result == Int.max ? -1 : result
    }
}
